import { createIcon } from "../icon/createIcon";

export const MinimizeIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="MinimizeIcon">
    <path d="M11 8v2H1V8h10z" />
  </svg>,
  "Minimize",
  "minimize"
);
